    false,nt"url": null,nt"notes": "This narrative report for Slade National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1945.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. Resource management
    is outlined; topics include grazing, haying, and fur harvesting. The public relations
    section of the report describes recreational uses, Refuge visitors, and violations.
    Items of interest and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
